import React from 'react'
import { View, text, TouchableOpacity, Image } from 'react-native'
import info from './info'
import { Avatar } from 'react-native-elements'

const CallOut = ({ data }) => {
    return (
        <>
            {
                info.hotels.m
            }
        </>
    )
}
export default CallOut
